const send = async () => {
    const connection = await amqp.connect('amqp://localhost');
    const channel = await connection.createChannel();
    await channel.assertQueue('patTest', { durable: false });
    channel.sendToQueue('patTest', Buffer.from('test message 1'));
    setTimeout(() => {
        connection.close();
    }, 500);
}

